  selector: 'gifs-card-list',
  templateUrl: './card-list.component.html',
  styleUrls: ['./card-list.component.css']
})
export class CardlistComponent {

  @Input()
  public gifs: Gif[] = [];
}
<div class="row">
  <gifs-card [gifs]="gifs"></gifs-card>
</div>
